import './Blog.css';

import { Container } from "react-bootstrap";

function Blog(){
    return(
        <Container fluid>
            <Container>
                <div className = 'blog-wrapper border'>
                    <p>Our Blog</p>
                    <h1>Latest Posts</h1>
                </div>
            </Container>
        </Container>
    )
}

export default Blog
